import React, { Component } from 'react';
import './Arts.css';
import Menu from '../../components/Menu/Menu';
import { artworks } from '../../shared/arts';



class Arts extends Component {

    render() {
        let arts = artworks.map(item => {
            console.log(item);
        // <div>{item}</div>
        });

        return(
            <div>
                <div className="SmallGreenSpace"></div>
                <Menu/>
                <div className="Arts">
                    <h1>Arts</h1>
                    {arts}
                </div>
            </div>
        );
    }
}
export default Arts;
